import HeaderLinks from "../app/PrivateLandingPage";
import * as React from "react";
import Header from "../../components/Header/Header";
import Parallax from "../../components/Parallax/Parallax";
import { makeStyles } from "@material-ui/core/styles";
import styles from "../../assets/jss/material-kit-react/views/landingPage.js";

const useStyles = makeStyles(styles);
export default  function CreateMnemonicPage(props){
    const classes = useStyles();
    return (
        <div>
            <Header
                color="transparent"
                brand="Private.Storage"
                fixed
                changeColorOnScroll={{
                    height: 400,
                    color: "white",
                }}
            />

            <Parallax >
                <div className={classes.container}>
                    <h1 className={classes.title}>把数据存放到一个安全，私密的地方</h1>
                    <h4>
                        Private.Storage是一个不被企业控制的并且更加隐私，安全的存储服务平台。
                        基于IPFS和Filecoin的分布式存储网络可确保您的数据在长久的时间范围内被安全、
                        可靠、高度私密性地存储
                    </h4>
                </div>
            </Parallax>
        </div>
    );
}
